  {name: "Cool Mist Humidifier Stick V2 By Deneve® - Mini Humidifier - Portable Humidifier - Travel Humidifier - Personal Humidifier - USB Humidifier - The Global Solution for Humidifying with just USB Ports", price: 22.99, description: "ALLEVIATE ALLERGIES, DRYNESS, AND RELIEVES COLD & FLU SYMPTOMS ANYWHERE with USB power with your very own Deneve Portable Humidifier Stick V2.\nMost hassle-free, worry-free, trouble-free, and portable personal humidifier on the market today. Simply plug the Deneve Mini Humidifier Stick V2 into nearly any USB power source, fill up a glass or water bottle with water, and insert humidifier. Small enough to easily fit into a coat pocket, let alone in your luggage.\nBacked by a 1-year 100% satisfaction guarantee! Portion of net proceeds donated to charity!\nSUPER PORTABLE AND VERSATILE:  With the Deneve Personal Humidifier Stick V2, never be frustrated by finding a suitable water bottle that fits. Never make a mess while refilling. Never be limited by built-in canisters or tanks. Never be stranded, leaving your AC adapter behind.  You provide the water supply in a cup or a bottle.  Use anywhere USB power ports are available.  Use as USB humidifier, mister, or even moisturizer.  Use anytime, anywhere: while sleeping, in hotels, in the nursery, while travelling on flights, on buses, or on trains, at work in the cubicle or the home office. Use anywhere suitable at-home or on-the-go.\nSUPER EASY TO USE:  1) Insert small end of the Deneve small humidifier stick V2 downward into empty cup or water bottle.   2) Fill up the cup or bottle with as much cool or cold water as you like, keeping the water below the USB charging port on humidifier, and without getting the top wet.  3) Wait 10 minutes to soak the internal filter.   4) Using USB cord, plug humidifier into a USB power port.  5) Press the small, clear button to turn humidifier on, and enjoy cool mist coming from the wide top of the humidifier! 6) Replace internal filter every 3 months max.", photo: "", photo_file_name: "http://ecx.images-amazon.com/images/I/313dkRaqu2L.jpg", photo_content_type: "", photo_file_size: 0, photo_updated_at: nil, url: "http://www.amazon.com/Cool-Mist-Humidifier-Stick-Deneve%C2%AE/dp/B00TD17MB2%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00TD17MB2", rating: 4.7, category: "Home"},
  {name: "Just Dance 2014 - Nintendo Wii U", price: 4.5, description: "Party Master:  Puppet Master mode has upgraded to the Party Master mode to give the player controlling the Wii U GamePad even more options to MC the party. Choose the next dance move, pick new songs, and dish out silly challenges to up to 4 other players!\nWorld Dance Floor: Dance with anyone anywhere in the world in Just Dance's first-ever online multiplayer mode! Players join a virtual crew--made up of real-life friends or other Just Dance fans--and compete based on different themes.\nOn Stage Mode:  Own the spotlight in this new mode where 1 player will dance, lead 2 back-up dancers, and even sing if they want! As the star of the show, the player can take it seriously and show off how talented they are, or just goof off with friends.\nCustom Sweat Mode: Players can personalize their Just Sweat workouts by creating custom playlists and tracking calories. There's also a new option to track calories in all gameplay modes, even outside of the dedicated Just Sweat mode.", photo: "", photo_file_name: "http://ecx.images-amazon.com/images/I/51qokd2D30L.jpg", photo_content_type: "", photo_file_size: 0, photo_updated_at: nil, url: "http://www.amazon.com/Just-Dance-2014-Nintendo-Wii-U/dp/B00D8IAND0%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00D8IAND0", rating: 0.0, category: "Video Games"},
