  {name: "Rocksmith 2014 Edition - PC/Mac (Cable Included)", price: 45.0, description: "A PROVEN METHOD TO LEARN GUITAR FAST National research studies have found that Rocksmith is the fastest way to learn guitar*. Over 95% of players have improved their skills. Whether you're a beginner or a seasoned player, Rocksmith gets you results, fast.*National study by Research Media Group Inc.\nFor technical assistance, the company Ubisoft has US phone agents ready to take your call at 1-888-610-2622 from 9 a.m. to midnight Eastern time on weekdays, and from Noon to 9:00 p.m. Eastern time on weekends. You may also submit an online request at http://support.ubi.com to get a subsequent reply by e-mail.\nLEARN YOUR FAVORITE SONGS   Select from over 50 hit tracks, ranging from alternative rock, to heavy metal, and more. You will learn to play your favorite songs, step-by-step and note-for-note, with tutorials along the way.\nDESIGNED FOR EASE AND SPEED   A new fully-customizable Riff Repeater lets you select your section, difficulty, and speed on-the-fly. Master Mode has been revamped to make learning by memory more approachable.\nGET PLUGGED IN Rocksmith 2014 Edition is compatible with the original Rocksmith Real Tone Cable that plugs any real guitar** directly into Xbox 360, PS3, PC, or Mac. **Guitar requires standard 1/4\" output jack.", photo: "", photo_file_name: "http://ecx.images-amazon.com/images/I/51Ro2KXGqQL.jpg", photo_content_type: "", photo_file_size: 0, photo_updated_at: nil, url: "http://www.amazon.com/Rocksmith-2014-Edition-Mac-Cable-Included/dp/B00D6PTMHI%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00D6PTMHI", rating: 3.7, category: "Video Games"},
