  {name: "Pablo's Pride Gourmet Coffee - Guatemala - Medium-dark Roast - Whole Bean - 2 Lb Bag", price: 13.99, description: "FREE Shipping on orders over $35\n2LB - Whole Bean - 100% Arabica\nA favorite of Coffee Lovers worldwide, this delicious coffee is roasted Medium-Dark, has a rich and lively aroma, velvety body, low acidity, and sweet pleasant aftertaste. This is a high altitude, shade grown coffee, and because Guatemala has numerous active volcanoes, the sulfur in the soil adds to its unique taste and depth of flavor.\nAt Café Don PabloTM we feel that our coffee is the finest available. We use only the largest, most desirable Arabica beans, grown in nutrient-rich volcanic soil in the lush mountainous terrain of the world's coffee growing regions. These are award-winning beans that were cultivated by skilled farmers whose methods, knowledge, and passion for coffee have been handed down from generation to generation since the very first seed was planted.\nWe roast these special beans in small batches to ensure our customers optimum flavor and freshness. We have found that people who really appreciate a great cup of rich, aromatic coffee can taste the difference between our fresh, just roasted product, and others that are roasted by the metric ton by huge corporations. We hope you agree. - Darron J. Burke President, Cafe Don Pablo", photo: "", photo_file_name: "http://ecx.images-amazon.com/images/I/51zu%2BhSCKVL.jpg", photo_content_type: "", photo_file_size: 0, photo_updated_at: nil, url: "http://www.amazon.com/Pablos-Pride-Gourmet-Coffee-Medium-dark/dp/B008FW60DG%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB008FW60DG", rating: 4.6, category: "Grocery"},
