oto_file_name: "http://ecx.images-amazon.com/images/I/51k6vr406TL.jpg", photo_content_type: "", photo_file_size: 0, photo_updated_at: nil, url: "http://www.amazon.com/Repeller-double-Output-three-Operation-Technology-Electronically/dp/B016Q4WO9S%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB016Q4WO9S", rating: 0.0, category: "Lawn & Patio"},
