  {name: "Amazon Fire TV Gaming Edition", price: 139.99, description: "All-new Fire TV Gaming Edition is everything you need for easy, affordable gaming on your HDTV - including Amazon Fire TV, Game Controller, two games, and a 32 GB microSD card for expanded storage\nIncludes two games ($24.98 value) - award-winning Shovel Knight and critically-acclaimed Disney DuckTales: Remastered\nTake gaming to the next level with the included Fire TV Game Controller, designed to fit comfortably in your hands with precise and responsive controls. Plus enjoy private listening using the headphone jack with Dolby Audio support.\nEnjoy console-style gaming with an up to 2 GHz quad-core processor, dedicated GPU and 2 GB of memory\nWith over 800 games, more than any other streaming media player, there is something for the entire family, including Minecraft, Lego Star Wars, and Pac-Man 256\nSay it. Watch it. Say the name of what you want to watch and start enjoying in seconds. Now with Alexa, use your Fire TV Game Controller to check sports scores or the weather, play music, and more - instantly.\nAll-new Amazon Fire TV now supports 4K Ultra HD for true-to-life picture quality. Watch high-definition 1080p streams on Amazon Video, Netflix, Hulu and more, even without a 4K TV. And access over 250,000 movies and TV episodes.", photo: "", photo_file_name: "http://ecx.images-amazon.com/images/I/41UPG%2BL94nL.jpg", photo_content_type: "", photo_file_size: 0, photo_updated_at: nil, url: "http://www.amazon.com/Amazon-Fire-TV-Gaming-Edition/dp/B00XNQECFM%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00XNQECFM", rating: 0.0, category: "Amazon SMP"},
