  {name: "Cardinal Toss Across Game", price: 19.95, description: "This modern take on the classic game of tic-tac-toe uses beanbags to flip squares on a large plastic frame.\nToss Across develops hand-eye coordination in a fun and challenging way.\nTry to flip over squares and line up three symbols in a row - or change an opponent's squares in the process - to win.\nThis exciting game for 2-4 players is This toy is suitable for indoor or outdoor play.\nRecommended for ages 5 years and up.\nCardinal is committed to making family-friendly, challenging, and innovative games and puzzles, and has been providing a wide range of games to our customers for over 60 years.\nIn today's electronic world of computer games and social media, basic game play and puzzle construction are vital to kids of all ages.\nFrom problem solving to developing memory and hand-eye coordination, Cardinal toys and games promote important attributes in kids.\nThe original Tic-Tac-Toes game with a twist\nEach player or team chooses to be an X or an O and gets three bean bags\nPlayers take turns tossing the bean bags underhand or overhand, trying to turn up their symbols - or undo opponents symbol\nThe object is to be the first player or team to turn up three of his symbols in a row\nFun for children and the whole family", photo: "", photo_file_name: "http://ecx.images-amazon.com/images/I/5144G11m%2BYL.jpg", photo_content_type: "", photo_file_size: 0, photo_updated_at: nil, url: "http://www.amazon.com/Cardinal-Industries-60026-Toss-Across/dp/B00CEZ1I46%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00CEZ1I46", rating: 0.0, category: "Toy"},
